import React, { Component } from "react";

class HabitBar extends Component {
  render() {
    return (
      <div className="bar-bgcolor">
        <span className="leaf">
          <i className="fa-solid fa-leaf"></i>
        </span>
        <span className="bar-name">Habit Tracker</span>
        <span className="habit-count">8</span>
      </div>
    );
  }
}

export default HabitBar;
